original_question:
افترض أن $\sin D = 0.7$ في الرسم البياني أدناه. ما هو $DE$؟ [asy]
pair D,E,F;
F = (0,0);
D = (sqrt(51),7);
E = (0,7);
draw(D--E--F--D);
draw(rightanglemark(D,E,F,15));
label("$D$",D,NE);
label("$E$",E,NW);
label("$F$",F,SW);
label("$7$",(E+F)/2,W);
[/asy]

